import Link from 'next/link';

const Navbar = () => (
    <ul>
        <li><Link href="/"><button>Home</button></Link></li>
        <li><Link href="/about"><button>About</button></Link></li>
        <li><Link href="/social"><button>Social</button></Link></li>
    </ul>
)

export default Navbar;
